import React from 'react';
import { Container } from '../home/styled'
import { GiBarracks } from "react-icons/gi";
import { GoCloudDownload, GoCreditCard, GoBell } from "react-icons/go";

function Home() {
  return (
    <Container>
      <div id="fundo">
        <div id="barraLateral">
          <div id="icones">
            <GiBarracks size={36} color="#FFF" />
            <GoCloudDownload size={36} color="#FFF" />
            <GoCreditCard size={36} color="#FFF" />
            <GoBrowser size={36} color="#FFF" />
            <GoBell size={36} color="#FFF" />
          </div>
        </div>
      </div>
    </Container>


  )
}

export default Home;
